import React from "react";
import logo from './images/PhilConLogo1.png';

const LoginPage = () => (
    <div>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Philanthropy Connect
        </p>
    </div>
);

export default LoginPage;
